import * as React from 'react';

import Typography from '@mui/material/Typography';
import Avatar from "@mui/material/Avatar";
import AvatarImg from "../images/avatar.png";
import Grid from "@mui/material/Grid";

export default function NavAppBar() {
  return (
    <Grid spacing="3" container direction="row" justifyContent="space-between" className="headerBox">
        <Grid xs={6}>
            <Typography component="h6" variant="h5"  xs="6">
              Demand Delivery
          </Typography>
        </Grid>
        <Grid  container justifyContent="flex-end" xs={6}>
            <Avatar src={AvatarImg} xs="6"></Avatar>
        </Grid>


    </Grid>
  );
}
